INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (100, "", "", 40000, 1, 36, 91002, 0, 0, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "ぺコリーヌ", "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 40001, 1, 37, 91002, 1, 107501, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "コッコロ", "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 40001, 2, 38, 91002, 1, 107601, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "キャル", "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 40001, 3, 39, 91002, 1, 107801, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "スズメ", "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40001, 4, 40, 91002, 1, 107701, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "タマキ", "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 40001, 5, 41, 91002, 1, 107901, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "ぺコリーヌ", "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 40001, 6, 42, 91002, 2, 107501, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "コッコロ", "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 40001, 7, 43, 91002, 2, 107601, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "キャル", "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 40001, 8, 44, 91002, 2, 107801, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "スズメ", "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 40001, 9, 45, 91002, 2, 107701, 8, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (150, "タマキ", "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 40001, 10, 46, 91002, 2, 107901, 8, 0);
