INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "リリ", "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 40011, 1, 321, 24001, 1, 125801, 2, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "クリア", "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 40011, 2, 322, 24001, 1, 126001, 2, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "プレシア", "んーと。\nこれ、あげる。\nはい", 40011, 3, 323, 24001, 1, 126101, 2, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "リリ", "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 40011, 4, 324, 24001, 2, 125801, 2, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 40011, 5, 325, 24001, 2, 126001, 2, 0);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES (1, "プレシア", "お兄。\nきてくれて、うれしい", 40011, 6, 326, 24001, 2, 126101, 2, 0);
